import './Dashboard.css'
import React from 'react'
const Note = ({ note }) => {
  const {  title, body } = note
  const onNoteClick = () => {
    console.log('clicked');
  }
  return (
    <div className='note-container' onClick={onNoteClick}>
      Title: {title}
      Body: {body}
    </div>
  )
}

export default Note
